// Extend Handlebars so there's a neat loader, since we will keep our layouts in the same folder
// assume .txt extension to avoid possible mimetype serve issues with other extensions
Handlebars.getTemplate = function(name) {
	var dbg = (false) ? '?' + Math.random() : ''; // true to prevent caching
	if (Handlebars.templates === undefined || Handlebars.templates[name] === undefined) {
		$.ajax({
			url : '../Layout/layouts/' + name + '.txt'+dbg,
			success : function(data) {
				if (Handlebars.templates === undefined) {
					Handlebars.templates = {};
				}
				Handlebars.templates[name] = Handlebars.compile(data);
			},
			async : false
		});
	}
	return Handlebars.templates[name];
};

Handlebars.registerHelper('areatag', function(index, label, r, s) {
	console.log("areatag", index,r,s);
	return label.slice(label.indexOf("<")).replace(/([\ ]?[\/]?)\>/,"")+
		 ' data-r="' + r + '"'+
		 ' data-s="' + s + '"'+
		 ' data-i="' + index + '"'+
		 ' title="' + label.replace(/(<[^>]*>?|[.\s])/g,"") + '"'+
		 '>';
});

Handlebars.registerHelper("navRecurse", function (page) {
	// if (!page) return;
	var template = Handlebars.getTemplate("nav");
	return template(page);
});

Handlebars.registerPartial("pageNav", "{{{navRecurse .}}}");

Handlebars.registerHelper("indexplus1",function(i){return (i+1)});

Handlebars.getCompiledTemplate = function (name, json) {
	var template = Handlebars.getTemplate(name);
	return template(json);
}

Handlebars.registerHelper('replace', function (str, a, b) {
	if(str && typeof str === "string") {
		return str.split(a).join(b);
	}
});

Handlebars.registerHelper('reflink', function (str) {
	if (str && typeof str === "string") {
		return str.replace("ref://", __global_root + "/en-us/Content/");
	}
});

Handlebars.registerHelper('nl2br', function(text) {
    var nl2br = (text + '').replace(/([^>\r\n]?)(\r\n|\n\r|\r|\n)/g, '$1' + '<br>' + '$2');
    return new Handlebars.SafeString(nl2br);
});

